
<!DOCTYPE html>

<html lang="en">
<head>
<meta charset="utf-8"/>
<title>Mosaic Image Tile Set with Hover Swap</title>
<style>
    body {
      font-family: Arial, sans-serif;
      margin: 0;
      padding: 20px;
      background-color: #f4f4f4;
    }
    .tile-container {
      display: grid;
      grid-template-columns: repeat(5, 1fr);
      grid-auto-rows: 150px;
      gap: 10px;
    }
    .tile {
      position: relative;
      overflow: hidden;
      border-radius: 8px;
      border: 1px solid #ddd;
      transition: transform 0.3s ease;
    }
    .tile:hover {
      transform: scale(1.03);
    }
    .tile img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      transition: opacity 0.3s ease;
      display: block;
    }
    .tile .hover-img {
      position: absolute;
      top: 0;
      left: 0;
      opacity: 0;
    }
    .tile:hover .hover-img {
      opacity: 1;
    }
    .tile:hover .default-img {
      opacity: 0;
    }
  </style>
</head>
